import React from 'react'
import styled from 'styled-components'

 export default function Widgets() {
     return (
         <Circles>
             <div className="circle-1"></div>
             <div className="circle-2"></div>

         </Circles>
     )
 }

 const Circles = styled.div`

       .circle-1{
           @media screen and (max-width : 600px) {
               height : 150px;
               width : 150px;
               position : absolute;
                top : 100px;
                left : 130px;
           }
        border-radius : 50%;
        height : 400px;
        width : 400px;
        position : absolute;
        bottom : 0;
        left : 0;
        transform : translate(-170px, 100px);
        background: linear-gradient(120deg, rgba(236,0,123,1) 0%, rgba(208,32,255,1) 29%, rgba(163,32,255,1) 54%, rgba(53,255,198,1) 100%);
       }
       .circle-2{
        @media screen and (max-width : 600px) {
               height : 100px;
               width : 100px;
               position : absolute;
                top : 100px;
                right : 40px;
           }
        border-radius : 50%;
        height : 350px;
        width : 350px;
        position : absolute;
        top : 100px;
        right : 0;
        transform : translateX(200px);
        background: linear-gradient(120deg, rgba(236,0,123,1) 0%, rgba(208,32,255,1) 29%, rgba(163,32,255,1) 54%, rgba(53,255,198,1) 100%);
       }
